import React from 'react';
import { BrowserRouter, Routes, Route, Link } from 'react-router-dom';
import LoginForm from './components/LoginForm'; // Assuming you have this component

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <div className="container">
          <h1 className="my-4">Gym Management System</h1>
          <nav>
            <ul className="nav">
              <li className="nav-item">
                <Link className="nav-link" to="/create-user">Create User</Link>
              </li>
            </ul>
          </nav>

          {/* Routes added here */}
          <Routes>
            <Route path="/" element={<LoginForm />} /> {/* Default route */}
            {/* Add a Route for the "/create-user" path */}
          </Routes>
        </div>
      </div>
    </BrowserRouter>
  );
}

export default App;
